import React, { useEffect, useState } from "react";

const Home = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("https://restate-mock-api.vercel.app/properties")
      .then(res => res.json())
      .then(data => {
        console.log("API Response:", data); // Debug
        setProperties(data);
        setLoading(false);
      })
      .catch(err => {
        console.log("API Fetch Error:", err);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p className="text-center text-xl font-semibold mt-6">‚è≥ Loading...</p>;
  }

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Featured Properties</h1>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {properties.length === 0 ? (
          <p className="text-red-500">‚ö† No properties found</p>
        ) : (
          properties.map((p) => (
            <div key={p.id} className="border p-4 rounded shadow hover:scale-105 transition bg-white">
              <img src={p.image} alt={p.title} className="rounded mb-3 h-48 w-full object-cover" />
              <h2 className="font-bold text-xl">{p.title}</h2>
              <p>üè∑ {p.type}</p>
              <p>üõè {p.bhk} BHK</p>
              <p>üìç {p.location}</p>
              <p className="text-green-600 font-semibold mt-2">‚Çπ {p.price}</p>
              <button className="w-full bg-blue-600 text-white py-2 mt-4 rounded hover:bg-blue-700">
                View Details
              </button>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default Home;
